import React from 'react';
import {Admin, Resource, EditGuesser, ShowGuesser} from 'react-admin';
import {RoleList, RoleCreate, RoleEdit} from './role';
import {User_allList, User_allEdit} from './user_all';
import {RightList, RightCreate} from './right';
import {UserCreate, UserEdit, UserList, UserShow} from './user';
import myDataProvider from "./api/dataProvider";
import mySvg from './logo.svg'
import Calender from "./comp/cal";
import langProvider from "./lang/langProvider";
import Layout from "./lang/Layout";

import CustomLayout from "./CustomLayout";

require('dotenv').config();
/**
 *
 * REACT ADMIN AND ALL REQUIRED COMPONENT
 *
 * @returns {*}
 * @constructor
 */

const App = () => <div style={{width: '95%'}}>

    <div style={{width: '100%'}}>
        <Admin dataProvider={myDataProvider}
               i18nProvider={langProvider}
               layout={CustomLayout}>
            <Resource name="user_all" list={User_allList} edit={User_allEdit}/>
            <Resource name="role" list={RoleList} create={RoleCreate} edit={RoleEdit}/>
            <Resource name="right" list={RightList} create={RightCreate} edit={EditGuesser} show={ShowGuesser}/>
            <Resource name="user_role"/>
            <Resource name="role_right"/>
        </Admin>
        <div className='footer'>
            <img src={mySvg} alt={mySvg} width={100} height={100}/>
        </div>
    </div>
</div>;

export default App

